import React, { useState } from "react";
import TextField from "../textField/textField";

const Login = (props) => {
  const [input, setinput] = useState("");
  return (
    <div className="login-wrapper">
      <TextField
        inputLabel="FirstName"
        setinput={setinput}
        input={input}
        loading="true"
      />
    </div>
  );
};

export default Login;
